def parse(path_to_file):
    # Поместите ваш код здесь.
    # ВАЖНО!!!
    # При открытии файла, добавьте в функцию open необязательный параметр
    # encoding='utf-8', его отсутствие в коде будет вызвать падение вашего
    # решения на грейдере с ошибкой UnicodeDecodeError

    file = open(path_to_file, encoding='utf-8')
    soup = BeautifulSoup(file, features="lxml")

    body = soup.find(id='bodyContent')

    images = [image for image in body.find_all('img') if image.has_attr('width') and int(image['width']) >= 200]
    images = len(images)
    # print(images)

    headers = body.find_all('h1')
    headers.extend(body.find_all('h2'))
    headers.extend(body.find_all('h3'))
    headers.extend(body.find_all('h4'))
    headers.extend(body.find_all('h5'))
    headers.extend(body.find_all('h6'))

    headers = [header for header in headers if header.text is not None and header.text[0] in ['E', 'T', 'C']]
    headers = len(headers)
    # print(headers)

    links = body.find_all('a')
    max_links_len = 0

    for link in links:
        current_link = link
        current_len = 1
        while current_link.find_next_sibling() is not None and current_link.find_next_sibling().name == 'a':
            current_link = current_link.find_next('a')
            current_len += 1

        max_links_len = max(max_links_len, current_len)

    # print(max_links_len)

    lists = body.find_all('ol')
    lists.extend(body.find_all('ul'))

    lists_len = 0
    for lst in lists:
        if not lst.find_parent('ol') and not lst.find_parent('ul'):
            lists_len += 1

    # print(lists_len)

    return [images, headers, max_links_len, lists_len]


def create_adjacent_list(path_to_folder, start_page):
    from os import listdir
    from os.path import isfile, join
    only_files = [path_to_folder + f for f in listdir(path_to_folder) if isfile(join(path_to_folder, f))]
    # print(only_files)

    visited = set()
    adjacent_list = {}
    queue = [path_to_folder + start_page]

    while queue:
        path_to_file = queue.pop()
        file = open(path_to_file, encoding='utf-8')
        soup = BeautifulSoup(file, features="lxml")
        visited.add(path_to_file)

        links = [link['href'] for link in soup.find_all('a') if link.has_attr('href') and
                 link['href'] in only_files]
        # print(links)

        adjacent_list[path_to_file] = links
        queue.extend([link for link in links if link not in visited])

    return adjacent_list


