def bfs(graph, start, end):
    # maintain a queue of paths
    queue = []
    # push the first path into the queue
    visited = set()
    queue.append([start])
    while queue:
        # get the first path from the queue
        path = queue.pop(0)
        # get the last node from the path
        node = path[-1]
        # path found
        if node == end:
            # print('ddddd')
            return path
        # enumerate all adjacent nodes, construct a new path and push it into the queue
        if node not in visited:
            # print(node)
            visited.add(node)
            for adjacent in graph.get(node, []):
                new_path = list(path)
                new_path.append(adjacent)
                queue.append(new_path)


def build_bridge(path_to_folder, start_page, end_page):
    """возвращает список страниц, по которым можно перейти по ссылкам со start_page на
    end_page, начальная и конечная страницы включаются в результирующий список"""

    graph = create_adjacent_list(path_to_folder, start_page)
    short_list = [page[len(path_to_folder):] for page in bfs(graph, path_to_folder + start_page, path_to_folder + end_page)]
    return short_list


def get_statistics(path_to_folder, start_page, end_page):
    """собирает статистику со страниц, возвращает словарь, где ключ - название страницы,
    значение - список со статистикой страницы"""

    # получаем список страниц, с которых необходимо собрать статистику
    pages = build_bridge(path_to_folder, start_page, end_page)
    # напишите вашу реализацию логики по сбору статистики здесь
    statistic = {}
    for page in pages:
        statistic[page] = parse(path_to_folder + page)

    return statistic
